import React from 'react';
import './SectionTitle.scss';

function SectionTitle(props) {

  const style = {
    color: props.white ? 'white' : '#555'
  }


  return(
    <h1 className="section-title" style = {style}> {props.children} </h1>
  )
}

export default SectionTitle;
